def calculate_max_profit(rates: list[int]) -> int:
    """"""
    if len(rates) < 2:
        raise ValueError('The list of rates must contain at least two elements.')
    ans = -9999999999999
    buy = rates[0]
    for sell in rates[1:]:
        buy = min(buy, sell)
        if ans < sell - buy:
            ans = sell - buy
    return ans
